import React from "react";
import { List } from "react";

const NavBar = () => (
  <nav>
    <ul>
      <li>
        <List to="/">Home</List>
        <List to="/about">about</List>
        <List to="/article-list">Article-List </List>
        <List to="/article">Article</List>
      </li>
    </ul>
  </nav>
);

export default NavBar;
